import React, { useState } from 'react';
import { FiX, FiChevronLeft, FiChevronRight } from 'react-icons/fi';
import './Gallery.css';

const Gallery = () => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [lightboxImage, setLightboxImage] = useState(null);
  const [lightboxIndex, setLightboxIndex] = useState(0);

  const categories = ['all', 'portrait', 'wedding', 'commercial', 'event'];
  const categoryLabels = {
    all: 'All Work',
    portrait: 'Portrait',
    wedding: 'Wedding',
    commercial: 'Commercial',
    event: 'Event'
  };

  // Sample gallery items - replace with actual images
  const galleryItems = [
    { id: 1, category: 'portrait', title: 'Portrait 1' },
    { id: 2, category: 'wedding', title: 'Wedding 1' },
    { id: 3, category: 'commercial', title: 'Commercial 1' },
    { id: 4, category: 'portrait', title: 'Portrait 2' },
    { id: 5, category: 'event', title: 'Event 1' },
    { id: 6, category: 'wedding', title: 'Wedding 2' },
    { id: 7, category: 'portrait', title: 'Portrait 3' },
    { id: 8, category: 'commercial', title: 'Commercial 2' },
    { id: 9, category: 'event', title: 'Event 2' },
    { id: 10, category: 'wedding', title: 'Wedding 3' },
    { id: 11, category: 'portrait', title: 'Portrait 4' },
    { id: 12, category: 'commercial', title: 'Commercial 3' },
  ];

  const filteredItems = selectedCategory === 'all' 
    ? galleryItems 
    : galleryItems.filter(item => item.category === selectedCategory);

  const openLightbox = (index) => {
    setLightboxIndex(index);
    setLightboxImage(filteredItems[index]);
  };

  const closeLightbox = () => {
    setLightboxImage(null);
  };

  const navigateLightbox = (direction) => {
    let newIndex = lightboxIndex + direction;
    if (newIndex < 0) newIndex = filteredItems.length - 1;
    if (newIndex >= filteredItems.length) newIndex = 0;
    setLightboxIndex(newIndex);
    setLightboxImage(filteredItems[newIndex]);
  };

  return (
    <div className="gallery-page">
      <div className="gallery-header">
        <div className="container">
          <h1 className="gallery-title">Gallery</h1>
          <p className="gallery-subtitle">Explore my collection of photography work</p>
        </div>
      </div>

      <div className="gallery-filters">
        <div className="container">
          <div className="filter-buttons">
            {categories.map(category => (
              <button
                key={category}
                className={`filter-btn ${selectedCategory === category ? 'active' : ''}`}
                onClick={() => setSelectedCategory(category)}
              >
                {categoryLabels[category]}
              </button>
            ))}
          </div>
        </div>
      </div>

      <div className="gallery-container">
        <div className="container">
          <div className="gallery-grid">
            {filteredItems.map((item, index) => (
              <div
                key={item.id}
                className="gallery-item"
                onClick={() => openLightbox(index)}
              >
                <div className="gallery-image">
                  <div className="gallery-placeholder">
                    <span>{item.title}</span>
                  </div>
                  <div className="gallery-overlay">
                    <span className="gallery-category">{categoryLabels[item.category]}</span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {lightboxImage && (
        <div className="lightbox" onClick={closeLightbox}>
          <button className="lightbox-close" onClick={closeLightbox}>
            <FiX />
          </button>
          <button 
            className="lightbox-nav lightbox-prev"
            onClick={(e) => {
              e.stopPropagation();
              navigateLightbox(-1);
            }}
          >
            <FiChevronLeft />
          </button>
          <button 
            className="lightbox-nav lightbox-next"
            onClick={(e) => {
              e.stopPropagation();
              navigateLightbox(1);
            }}
          >
            <FiChevronRight />
          </button>
          <div className="lightbox-content" onClick={(e) => e.stopPropagation()}>
            <div className="lightbox-image">
              <div className="lightbox-placeholder">
                <span>{lightboxImage.title}</span>
              </div>
            </div>
            <div className="lightbox-info">
              <h3>{lightboxImage.title}</h3>
              <p>{categoryLabels[lightboxImage.category]}</p>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Gallery;
